AKUSTİK GİTAR, TAMAMEN MAUN
&nbsp;
&nbsp;KONSER TİPİ KASA
Konser tipş kasa ölçüsü daha küçük olmasına rağmen Dreadnought kasa tipine göre daha odaklı ve dengeli sesler üretir. Baslar daha az vurguludur ve orta bölgededaha berrak ve tatlı yükseklere sahiptir. Konser tipi kasanın sonik dengesi onu fingerpicking &nbsp;ve solo &nbsp;tekli nota çalışları için ideal kasa yapar.&nbsp;&nbsp;TAMAMEN MAUN MODEL
En son gitar piyasası trendlerine uygun olarak bu gitarın sadece arka ve yanları maun değil üst kapağı da maundan yapılmıştır. ladine oranla daha koyu bir sesi vardır. Maun orta bölgede tam zengin ve daha sıcak sesler üretir.&nbsp;
&nbsp;
&nbsp;DOVETAIL SAP BAĞLANTISI
Deneyimli ustalarca titiz bir işçilikle yapılan güçlü kırlangıç tipi &nbsp;sap bağlantısı (dovetail) kasanın vibrasyon ve enerjisini kayıpsız olarak detaylı şekilde aktarır.&nbsp;
&nbsp;
&nbsp;KAPLANMIŞ TELLER
Tellerdeki yüksek kaliteli kaplama rutubet, kir ve tere karşı direnci&nbsp;artırmakta ve böylece tel ömrünü uzatmakla birlikte çalınabilirliği de geliştirmektedir.&nbsp;
&nbsp;
&nbsp;OYLUMLU KÖPRÜ
Cort'un özel oylumlu köprü düzlüğü sayesinde eşikten kasaya daha büyük bir açı ile ulaşan teller sustaini (tınlama uzunluğu) artırırken sap boyunca tellerdeki gerilimi düşürerek hem parmakların daha az yorulmasını sağlamakta hem de çalınabilirliği geliştirmektedir.&nbsp;
&nbsp;
